        function reset(obj)
            obj.time=0;
            obj.observerState=zeros(60,1);
            obj.u=zeros(20,1);
            obj.iter=0;
            obj.dt=0.01;
            obj.measuredDisturbance=[];
            obj.KAlg=[];
        end
        function val=returnObserverState(obj)
            val=obj.observerState;
        end
%         function val=returnControlInput(obj)
%             val=obj.u;
%         end
        function val=returnBaseAccel(obj)
            val=obj.measuredDisturbance(end);
        end
        function val=returnFloorAcc(obj)
            floorAccels=zeros(20,1);
            for i=1:1:length(obj.floorSensors)
                a=(obj.floorSensors(i).returnSensorOutput());
                floorAccels(i)=a(1);
            end
            val=floorAccels;
        end
        function generateControl(obj)
            if obj.contrObj.time>=obj.time+obj.dt
                obj.measuredDisturbance=[obj.measuredDisturbance;-obj.baseSensor.returnSensorOutput()];
                tempLength=min([length(obj.measuredDisturbance),obj.N]);
                obj.measuredDisturbance=obj.measuredDisturbance(end-tempLength+1:end);
                floorAccels=zeros(20,1);
                for i=1:1:length(obj.floorSensors)
                    a=(obj.floorSensors{i}.returnSensorOutput());
                    floorAccels(i)=a(1);
                end
                %                 disp(obj.measuredDisturbance(end));
                %                                 disp(floorAccels);
                %                                 [~,xKalman]=ode45(@(t,y)(obj.aKalman*[-floorAccels;y]+obj.bKalman*[obj.u;obj.measuredDisturbance(end)]),[obj.time, obj.contrObj.time],obj.observerState);
                %                                 xKal(:,i)=A_d2*xKal(:,i-1)+B_d2(1:40)*measBaseAccel(i-1)+Ld*((measAccel(i,:))'-C(:,1:40)*xKal(:,i-1));
                %                 disp(['1']);
                %                 disp([size(obj.observerState)]);
                %                 disp('A');
                %                 disp(size(obj.matADiscr));
                %                 disp('B');
                %                 disp(size(obj.matBDiscr));
                %                 disp('C');
                %                 disp(size(obj.matC));
                %                 disp('L');
                %                 disp(size(obj.matKalDiscr));
                %                 disp('ag');
                %                 disp(size(obj.measuredDisturbance(end)));
                %                 disp('a_floors');
                %                 disp(size(obj.measuredDisturbance(end)));
                obj.observerState=(obj.matADiscr-obj.matKalDiscr*obj.matC)*obj.observerState+obj.matBDiscr*[obj.u;obj.measuredDisturbance(end)]+obj.matKalDiscr*floorAccels;
                %                 disp(['2']);
                %                 disp([size(obj.observerState)]);
                %                 disp(size(xKalman));
                %                  xKalman=obj.aModel*obj.observerState+obj.bKalman*[obj.u;obj.measuredDisturbance(end)];
                %                 xKalman=xKalman';
                %                 obj.observerState=xKalman;
                if obj.iter<obj.S
                    %                     disp(size(obj.observerState));
                    %
                    obj.KAlg=obj.matLQRDiscr;
                else
                    if mod(obj.iter,6)==0
                        if size(obj.measuredDisturbance, 1)==1
                            G=obj.AR( obj.measuredDisturbance, obj.n);
                        else
                            G=obj.AR( obj.measuredDisturbance', obj.n);
                        end
                        %                         disp('G');
                        %                         disp(G);
                        maxeig=max(abs(eigs(G)));
                        maxeig2=max(1,maxeig*1.01);
                        A_2=[obj.matADiscr, obj.matBDiscr(:,end)*[zeros(1,obj.n-1),1];zeros(obj.n,size(obj.matADiscr,1)),G];
                        [~,~,obj.KAlg,flag]=dare(1/(maxeig2)*A_2,1/(maxeig2)*[obj.matBDiscr(:,1:end-1);zeros(obj.n,size(obj.matBDiscr(:,1:end-1),2))],obj.Q2,obj.R,[],[]);
                        while flag<0
                            disp(flag);
                            disp(maxeig);
                            disp(maxeig2);
                            maxeig2=maxeig2*1.01;
                            [~,~,obj.KAlg,flag]=dare(1/(maxeig2)*A_2,1/(maxeig2)*[obj.matBDiscr(:,1:end-1);zeros(obj.n,size(obj.matBDiscr(:,1:end-1),2))],obj.Q2,obj.R,[],[]);
                        end
                        %                         obj.u=-KAlg*[obj.observerState;obj.measuredDisturbance(end-obj.n+1:end)];
                    end
                    
                end
                if size(obj.KAlg,2)<=60
                    obj.u=-obj.KAlg*obj.observerState;
                else
                    obj.u=-obj.KAlg*[obj.observerState;obj.measuredDisturbance(end-obj.n+1:end)];
                end
                %                 obj.u=zeros(20,1);
                obj.actuators{1}.setInput(obj.u);
                
                obj.iter=obj.iter+1;
                obj.time=obj.contrObj.time;
            end
        end
        
        function [ G ] = AR(obj, data, n )
            %UNTITLED12 Summary of this function goes here
            %   Detailed explanation goes here
            l=size(data,2);
            if l==1
                disp('l==1!!!');
            end
            Y=(data(1,1+n:end))';
            phi=zeros(l-n,n);
            for i=1:1:l-n
                phi(i, :)=data(1,i:i+n-1);
            end
            
            
            theta=pinv(phi)*Y;
            G=[zeros(n-1,1), eye(n-1);theta'];
            %             disp('data');
            %             disp(data);
            %             disp('theta');
            %             disp(theta);
            %             figure;
            %             plot(data);
            %             title('ansys');
        end
    end
    
